import Link from "next/link";
const Navbar = () => {
  const styles = {
    display: "flex",
    background: "grey",
    justifyContent: "space-between",
    padding: "1rem",
  };
  return (
    <div>
      <div
        style={{
          display: "flex",
          justifyContent: "space-between",
          width: "500px",
        }}
      >
        <div style={{ width: "100%", margin: "auto" }}>
          <Link href="/about">
            <a>About Page</a>
          </Link>
        </div>
        <div style={{ width: "100%", margin: "auto" }}>
          <Link href="/contact">
            <a>Contact</a>
          </Link>
        </div>
        <div style={{ width: "100%", margin: "auto" }}>
          <Link href="/about">
            <a>About Page Again Lol</a>
          </Link>
        </div>
      </div>
    </div>
  );
};
export default Navbar;
